        // console.log('Form data:', formData);
        submittedFromData = formData;
        console.log(submittedFromData);
    };

    return (
        <div className={'test-class'}>
            <>
                <>
                    <Form title={fromTitle} size={inputSize} onSubmit={onFormSubmit}/>
                    <Form title={'Anothe title'} onSubmit={onFormSubmit}/>
                    <Form title={'3rd form'} onSubmit={onFormSubmit} size={1}/>
                </>
            </>
        </div>
    );
}

export default App;
